import React, { useState, useEffect } from 'react';

function MyPage() {
    const [nickName, setNickName] = useState('');
    const [testResults, setTestResults] = useState([]);


  useEffect(() => {
    const fetchNickName = async () => {
      try {
        const response = await fetch('http://localhost:8080/user/getUserNickName', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
            'Authorization': `Bearer ${localStorage.getItem('token')}`
          }
        });

        if (response.ok) {
          const nickName = await response.text();
          setNickName(nickName);
        } else {
            alert('로그인이 필요합니다.');
            window.location.href = '/user/signIn';
        }
      } catch (error) {
        alert('로그인이 필요합니다.');
        window.location.href = '/user/signIn';
      }
    };

    fetchNickName();
  }, []);

  useEffect(() => {
    const fetchTestResults = async () => {
      try {
        const response = await fetch('http://localhost:8080/ping/getTestResult', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
            'Authorization': `Bearer ${localStorage.getItem('token')}`
          }
        });
        if (response.ok) {
            const data = await response.json();
            setTestResults(data);
        }
        else {
            alert('로그인이 필요합니다.');
            window.location.href = '/user/signIn';
        }
      } catch (error) {
        alert('로그인이 필요합니다.');
        window.location.href = '/user/signIn';
      }
    };

    fetchTestResults();
  }, []);


  return (
    <div>
      <h1 className='userIP'>{nickName ? `${nickName}'s Page` : 'Loading...'}</h1>
      <ul>
        {testResults.map((result, index) => (
          <li key={index}>
            Day: {result.id.day}, Hour: {result.id.hour}, Average Time: {result.averageTime}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default MyPage;
